import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Set up cart with an item first
    await page.evaluate(() => {
      const cart = [{
        id: 1,
        title: "Apple iPhone 15 Pro Max, 256GB, Natural Titanium",
        price: 1199.99,
        image: "https://m.media-amazon.com/images/I/81Os1SDWpcL._AC_UY327_FMwebp_QL65_.jpg",
        seller: "Apple Store",
        quantity: 1
      }];
      localStorage.setItem('amazonCart', JSON.stringify(cart));
    });

    // Reload to apply cart changes
    await page.reload();
    await page.waitForLoadState('networkidle');

    // Open cart modal
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal and take screenshot
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_open.png'));

    // Remove item from cart
    await page.waitForSelector('.remove-item', { timeout: 5000 });
    await page.click('.remove-item');

    // Wait for cart to update and verify removal
    await page.waitForSelector('.empty-cart', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_empty.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_empty.png'));

    // Close cart modal
    await page.click('#cartModal .close');
    await page.waitForSelector('#cartModal', { state: 'hidden', timeout: 5000 });

    // Verify cart count is 0
    const cartCount = await page.$eval('#cartCount', el => el.textContent);

    return {
      success: true,
      action: "Successfully removed item from cart",
      extractedData: {
        cartCount: parseInt(cartCount)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
